using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AoC.Puzzles
{

    class D2
    {
        static string input = "    ";

        static int h = 3;

        static int w = 3;

        static int x = 1;

        static int y = 1;

        public D2()
        {
            //Console.WriteLine(GetButton("RDLLLUUULRRRR"));

            var str = "";
            var ins = input.Split(' ');
            foreach (var i in ins)
            {
                str += GetButton(i);
            }
            Console.WriteLine(str);
        }

        int GetButton(string str)
        {
            foreach (var c in str)
            {
                switch (c)
                {
                    case 'U':
                        y = (y == 2) ? 2 : y + 1;
                        break;
                    case 'D':
                        y = (y == 0) ? 0 : y - 1;
                        break;
                    case 'R':
                        x = (x == 2) ? 2 : x + 1;
                        break;
                    case 'L':
                        x = (x == 0) ? 0 : x - 1;
                        break;
                }
            }
            return (2 - y) * 3 + x + 1;
        }

    }
}
